"use strict";$(document).ready(function(){window.onscroll=function(){var n=3;document.body.style.backgroundPosition=-window.pageYOffset/n+"px "+-window.pageXOffset/n+"px";document.getElementById("mid_bg").style.backgroundPosition=-window.pageYOffset/(2*n)+"px "+-window.pageXOffset/(2*n)+"px";document.getElementById("near_bg").style.backgroundPosition=-window.pageYOffset/(5*n)+"px "+-window.pageXOffset/(5*n)+"px"};$('a[href*="#"]:not([href="#"])').click(function(){if(location.pathname.replace(/^\//,"")==this.pathname.replace(/^\//,"")&&location.hostname==this.hostname){var n=$(this.hash);if(n=n.length?n:$("[name="+this.hash.slice(1)+"]"),n.length)return $("html, body").animate({scrollTop:n.offset().top},1e3),!1}});$("#contact_me").click(function(){document.getElementById("contact").scrollIntoView({behavior:"smooth"})});$(".hello-ajax").click(function(){$.ajax({type:"GET",url:'@Url.Action("HelloAjax")',success:function(n){$("#result1").html(n)}})});$(".button-collapse").sideNav()});